comment_data.body:
I think this should be:

```js
if (parsed.error) {
  this.emit('error', parsed.error);
  this.end("ProtocolError");
  return;
}
```
(don't forget the `return`)

Also this way your server can do something like:

```js
client.on('error', function(err) {
  // do something with err.message, err.stack, or both.
  // or not
});
```

And if the server does not add an 'error' event, the server will crash with the error message. This is idiomatic node.js.

